About: On day little Betty is a naive young girl from a small town who comes to the &quot;big city&quot; looking for fame fortune and her big break into showbiz. Before she realizes what is happening, she is transformed into the perky, bikini-clad, pin-up starlet with raven-hair, a trademark bang, and red-hot lips who started a revolution! A girl's gotta do what a girl's gotta do. Betty bares it all to earn a buck to pay for her next hot meal. Making ends meet has never been SO SEXY!
